import { Table } from "react-bootstrap";
import { Form } from "./components/form/Form";
import PersonTable from "./components/table/PersonTable";

const tableMetaData = ({}) => [
  {
    headerTitle: "ID",
    fieldName: "id",
    render: (rowData) => <>{rowData["id"]}</>,
  },
  {
    headerTitle: "Name",
    fieldName: "name",
    render: (rowData) => <>{rowData["name"]}</>,
  },
  {
    headerTitle: "Age",
    fieldName: "age",
    render: (rowData) => <>{rowData["age"]}</>,
  },
  {
    headerTitle: "Gender",
    fieldName: "gender",
    render: (rowData) => <>{rowData["gender"]}</>,
  },
  {
    headerTitle: "DOB",
    fieldName: "dateOfBirth",
    render: (rowData) => <>{rowData["dateOfBirth"]}</>,
  },
  {
    headerTitle: "Area",
    fieldName: "area",
    render: (rowData) => <>{rowData["area"]}</>,
  },
  {
    headerTitle: "Email",
    fieldName: "email",
    render: (rowData) => <>{rowData["email"]}</>,
  },
  {
    headerTitle: "Phonenumber",
    fieldName: "phonenumber",
    render: (rowData) => <>{rowData["phonenumber"]}</>,
  },
  {
    headerTitle: "Occupation",
    fieldName: "occupation",
    render: (rowData) => <>{rowData["occupation"]}</>,
  },
  {
    headerTitle: "Actions",
    render: (rowData) => (
      <>
        <div className="row">
          <div className="col-md-6">
            <button>Edit</button>
          </div>
          <div className="col-md-6">
            <button>Delete</button>
          </div>
        </div>
      </>
    ),
  },
];

function App() {
  return (
    <div className="container mt-5">
      <Form />
      <Table tableMetaData={tableMetaData} />
    </div>
  );
}

export default App;
